// =====================================================
// FUNGSI EEPROM
// =====================================================
void writeStringToEEPROM(int address, String data) {
  for (int i = 0; i < data.length(); ++i) {
    EEPROM.write(address + i, data[i]);
  }
  EEPROM.write(address + data.length(), 0); // Null terminator
  EEPROM.commit();
}

String readStringFromEEPROM(int address, int len) {
  char data[len + 1];
  for (int i = 0; i < len; ++i) {
    data[i] = EEPROM.read(address + i);
  }
  data[len] = '\0'; // Null terminator
  return String(data);
}

void loadCredentials() {
  EEPROM.begin(EEPROM_SIZE);
  sta_ssid = readStringFromEEPROM(EEPROM_SSID_ADDR, 32);
  sta_password = readStringFromEEPROM(EEPROM_PASS_ADDR, 32);
  idMeter = readStringFromEEPROM(EEPROM_ID_METER_ADDR, 32);
  deviceJwtToken = readStringFromEEPROM(EEPROM_JWT_ADDR, 256); // JWT bisa lebih panjang

  DEBUG_SERIAL.print("Loaded SSID: "); DEBUG_SERIAL.println(sta_ssid);
  DEBUG_SERIAL.print("Loaded Password: "); DEBUG_SERIAL.println(sta_password);
  DEBUG_SERIAL.print("Loaded ID Meter: "); DEBUG_SERIAL.println(idMeter);
  DEBUG_SERIAL.print("Loaded JWT: "); DEBUG_SERIAL.println(deviceJwtToken.substring(0, 10) + "..."); // Print sebagian saja
}

void saveCredentials() {
  writeStringToEEPROM(EEPROM_SSID_ADDR, sta_ssid);
  writeStringToEEPROM(EEPROM_PASS_ADDR, sta_password);
  writeStringToEEPROM(EEPROM_ID_METER_ADDR, idMeter);
  writeStringToEEPROM(EEPROM_JWT_ADDR, deviceJwtToken);
  EEPROM.commit();
  DEBUG_SERIAL.println("Credentials saved to EEPROM.");
}

void clearCredentials() {
  for (int i = 0; i < EEPROM_SIZE; ++i) {
    EEPROM.write(i, 0);
  }
  EEPROM.commit();
  DEBUG_SERIAL.println("EEPROM cleared.");
}

// =====================================================
// FUNGSI KOMUNIKASI DENGAN BACKEND
// =====================================================
String httpPOST(const char* endpoint, String payload, String jwt = "") {
  WiFiClient client;
  HTTPClient http;

  String url = String(API_BASE_URL) + endpoint;
  http.begin(client, url);
  http.addHeader("Content-Type", "application/json");
  if (jwt.length() > 0) {
    http.addHeader("Authorization", "Bearer " + jwt);
  }

  DEBUG_SERIAL.print("Sending POST to: "); DEBUG_SERIAL.println(url);
  DEBUG_SERIAL.print("Payload: "); DEBUG_SERIAL.println(payload);

  int httpResponseCode = http.POST(payload);
  String response = "";

  if (httpResponseCode > 0) {
    DEBUG_SERIAL.printf("[HTTP] POST... code: %d\n", httpResponseCode);
    response = http.getString();
  } else {
    DEBUG_SERIAL.printf("[HTTP] POST... failed, error: %s\n", http.errorToString(httpResponseCode).c_str());
  }
  http.end();
  return response;
}

bool registerDevice(String provisioningToken) {
  DynamicJsonDocument doc(256);
  doc["provisioning_token"] = provisioningToken;
  doc["device_id"] = String(ESP.getChipId()); // Menggunakan Chip ID sebagai ID unik perangkat

  String payload;
  serializeJson(doc, payload);

  String response = httpPOST(REGISTER_DEVICE_ENDPOINT, payload);

  DynamicJsonDocument responseDoc(512);
  DeserializationError error = deserializeJson(responseDoc, response);

  if (error) {
    DEBUG_SERIAL.print(F("Deserialisasi JSON respons registrasi gagal: "));
    DEBUG_SERIAL.println(error.c_str());
    return false;
  }

  if (responseDoc["status"] == "success") {
    idMeter = responseDoc["id_meter"].as<String>();
    deviceJwtToken = responseDoc["jwt"].as<String>();
    isDeviceRegistered = true;
    DEBUG_SERIAL.println("Device registered successfully!");
    saveCredentials(); // Simpan idMeter dan JWT baru
    return true;
  } else {
    DEBUG_SERIAL.print("Device registration failed: ");
    DEBUG_SERIAL.println(responseDoc["message"].as<String>());
    return false;
  }
}

void sendMeterReading(String flowRate, String meterReading, String voltage, int doorStatus, String valveStatus) {
  if (!isDeviceRegistered || !isWiFiConnected) {
    DEBUG_SERIAL.println("Device not registered or WiFi not connected. Skipping meter reading send.");
    return;
  }

  DynamicJsonDocument doc(512);
  doc["id_meter"] = idMeter;
  doc["flow_rate_lpm"] = flowRate;
  doc["meter_reading_m3"] = meterReading;
  doc["current_voltage"] = voltage;
  doc["door_status"] = doorStatus;
  doc["valve_status"] = valveStatus;

  String payload;
  serializeJson(doc, payload);

  String response = httpPOST(SUBMIT_READING_ENDPOINT, payload, deviceJwtToken);

  DynamicJsonDocument responseDoc(256);
  DeserializationError error = deserializeJson(responseDoc, response);

  if (error) {
    DEBUG_SERIAL.print(F("Deserialisasi JSON respons meter reading gagal: "));
    DEBUG_SERIAL.println(error.c_str());
    return;
  }

  if (responseDoc["status"] == "success") {
    DEBUG_SERIAL.println("Meter reading sent successfully.");
    // Update pulsa dan status unlock dari server
    float newPulsa = responseDoc["data_pulsa"].as<float>();
    float newTarif = responseDoc["tarif_per_m3"].as<float>();
    bool newUnlockedStatus = responseDoc["is_unlocked"].as<bool>();

    // Kirim ke Arduino
    DynamicJsonDocument arduinoUpdateDoc(128);
    arduinoUpdateDoc["id_meter"] = idMeter;
    arduinoUpdateDoc["data_pulsa"] = newPulsa;
    arduinoUpdateDoc["tarif_per_m3"] = newTarif;
    arduinoUpdateDoc["is_unlocked"] = newUnlockedStatus;
    String arduinoUpdatePayload;
    serializeJson(arduinoUpdateDoc, arduinoUpdatePayload);
    ARDUINO_SERIAL.println(arduinoUpdatePayload);
    DEBUG_SERIAL.print("Tx Arduino (Update): "); DEBUG_SERIAL.println(arduinoUpdatePayload);

  } else {
    DEBUG_SERIAL.print("Failed to send meter reading: ");
    DEBUG_SERIAL.println(responseDoc["message"].as<String>());
  }
}

void pollForCommands() {
  if (!isDeviceRegistered || !isWiFiConnected) {
    DEBUG_SERIAL.println("Device not registered or WiFi not connected. Skipping command poll.");
    return;
  }

  WiFiClient client;
  HTTPClient http;

  String url = String(API_BASE_URL) + GET_COMMANDS_ENDPOINT + "?id_meter=" + idMeter;
  http.begin(client, url);
  http.addHeader("Authorization", "Bearer " + deviceJwtToken);

  DEBUG_SERIAL.print("Polling for commands from: "); DEBUG_SERIAL.println(url);

  int httpResponseCode = http.GET();
  String response = "";

  if (httpResponseCode > 0) {
    DEBUG_SERIAL.printf("[HTTP] GET... code: %d\n", httpResponseCode);
    response = http.getString();
  } else {
    DEBUG_SERIAL.printf("[HTTP] GET... failed, error: %s\n", http.errorToString(httpResponseCode).c_str());
  }
  http.end();

  DynamicJsonDocument responseDoc(512);
  DeserializationError error = deserializeJson(responseDoc, response);

  if (error) {
    DEBUG_SERIAL.print(F("Deserialisasi JSON perintah gagal: "));
    DEBUG_SERIAL.println(error.c_str());
    return;
  }

  if (responseDoc["status"] == "success" && responseDoc.containsKey("commands")) {
    JsonArray commands = responseDoc["commands"].as<JsonArray>();
    for (JsonObject command : commands) {
      String command_type = command["command_type"].as<String>();
      int command_id = command["command_id"].as<int>();
      String current_valve_status = command["current_valve_status"].as<String>(); // Status valve yang dilaporkan server

      DEBUG_SERIAL.print("Received command: "); DEBUG_SERIAL.println(command_type);

      // Kirim perintah ke Arduino
      DynamicJsonDocument arduinoCommandDoc(256);
      arduinoCommandDoc["command_type"] = command_type;
      arduinoCommandDoc["command_id"] = command_id;
      arduinoCommandDoc["current_valve_status"] = current_valve_status; // Teruskan status valve dari server
      
      // Jika ada config_data, teruskan juga
      if (command.containsKey("config_data")) {
        arduinoCommandDoc["config_data"] = command["config_data"];
      }

      String arduinoCommandPayload;
      serializeJson(arduinoCommandDoc, arduinoCommandPayload);
      ARDUINO_SERIAL.println(arduinoCommandPayload);
      DEBUG_SERIAL.print("Tx Arduino (Command): "); DEBUG_SERIAL.println(arduinoCommandPayload);
    }
  } else {
    DEBUG_SERIAL.print("No new commands or failed to get commands: ");
    DEBUG_SERIAL.println(responseDoc["message"].as<String>());
  }
}

void sendCommandAck(int commandId, String status, String notes, String reportedValveStatus) {
  if (!isDeviceRegistered || !isWiFiConnected) {
    DEBUG_SERIAL.println("Device not registered or WiFi not connected. Skipping command ACK.");
    return;
  }

  DynamicJsonDocument doc(256);
  doc["id_meter"] = idMeter;
  doc["command_id_ack"] = commandId;
  doc["status_ack"] = status;
  doc["notes_ack"] = notes;
  doc["valve_status_ack"] = reportedValveStatus; // Status valve yang dilaporkan Arduino

  String payload;
  serializeJson(doc, payload);

  String response = httpPOST(ACK_COMMAND_ENDPOINT, payload, deviceJwtToken);

  DynamicJsonDocument responseDoc(128);
  DeserializationError error = deserializeJson(responseDoc, response);

  if (error) {
    DEBUG_SERIAL.print(F("Deserialisasi JSON respons ACK gagal: "));
    DEBUG_SERIAL.println(error.c_str());
    return;
  }

  if (responseDoc["status"] == "success") {
    DEBUG_SERIAL.print("Command ACK sent successfully for ID: ");
    DEBUG_SERIAL.println(commandId);
  } else {
    DEBUG_SERIAL.print("Failed to send command ACK: ");
    DEBUG_SERIAL.println(responseDoc["message"].as<String>());
  }
}

// =====================================================
// FUNGSI KONEKSI WI-FI
// =====================================================
void connectWiFiSTA() {
  DEBUG_SERIAL.print("Connecting to WiFi: ");
  DEBUG_SERIAL.println(sta_ssid);
  WiFi.mode(WIFI_STA);
  WiFi.begin(sta_ssid.c_str(), sta_password.c_str());

  int attempts = 0;
  while (WiFi.status() != WL_CONNECTED && attempts < 30) { // Coba 30 kali (30 detik)
    delay(1000);
    DEBUG_SERIAL.print(".");
    attempts++;
  }

  if (WiFi.status() == WL_CONNECTED) {
    DEBUG_SERIAL.println("\nWiFi connected!");
    DEBUG_SERIAL.print("IP address: ");
    DEBUG_SERIAL.println(WiFi.localIP());
    isWiFiConnected = true;
  } else {
    DEBUG_SERIAL.println("\nFailed to connect to WiFi.");
    isWiFiConnected = false;
    // Jika gagal konek, mungkin kredensial salah atau jaringan tidak tersedia.
    // Kembali ke mode AP untuk re-provisioning.
    DEBUG_SERIAL.println("Switching to AP mode for re-provisioning...");
    clearCredentials(); // Hapus kredensial yang mungkin salah
    setupAPMode(); // Panggil setupAPMode untuk memulai ulang proses provisioning
  }
}

void setupAPMode() {
  DEBUG_SERIAL.println("Entering AP Mode for Provisioning...");
  WiFi.mode(WIFI_AP);
  String ap_ssid = "IWSDD-Setup-" + String(ESP.getChipId());
  WiFi.softAP(ap_ssid.c_str());

  DEBUG_SERIAL.print("AP SSID: ");
  DEBUG_SERIAL.println(ap_ssid);
  DEBUG_SERIAL.print("AP IP Address: ");
  DEBUG_SERIAL.println(WiFi.softAPIP());

  // Setup mDNS (opsional)
  if (MDNS.begin("indowater-setup")) {
    DEBUG_SERIAL.println("mDNS responder started");
  }

  // Handle root path (serving HTML)
  server.on("/", HTTP_GET, []() {
    // Format the HTML with the actual device ID
    char htmlBuffer[sizeof(PROVISIONING_HTML) + 20]; // +20 for device ID
    sprintf(htmlBuffer, PROVISIONING_HTML, String(ESP.getChipId()).c_str());
    server.send_P(200, "text/html", htmlBuffer);
  });

  // Handle form submission
  server.on("/submit", HTTP_POST, []() {
    String responseJson = "{\"status\":\"failed\", \"message\":\"Invalid request\"}";
    if (server.hasHeader("Content-Type") && server.header("Content-Type").indexOf("application/json") != -1) {
      String requestBody = server.arg("plain");
      DynamicJsonDocument doc(256);
      DeserializationError error = deserializeJson(doc, requestBody);

      if (!error) {
        String token = doc["provisioning_token"].as<String>();
        String ssid = doc["ssid"].as<String>();
        String password = doc["password"].as<String>();

        DEBUG_SERIAL.print("Received token: "); DEBUG_SERIAL.println(token.substring(0, 5) + "...");
        DEBUG_SERIAL.print("Received SSID: "); DEBUG_SERIAL.println(ssid);
        DEBUG_SERIAL.print("Received Password: "); DEBUG_SERIAL.println(password.substring(0, 5) + "...");

        if (registerDevice(token)) {
          sta_ssid = ssid;
          sta_password = password;
          saveCredentials(); // Simpan SSID dan Password baru
          responseJson = "{\"status\":\"success\", \"message\":\"Device provisioned. Restarting...\"}";
          server.send(200, "application/json", responseJson);
          delay(1000); // Beri waktu klien menerima respons
          ESP.restart(); // Restart untuk beralih ke STA mode
        } else {
          responseJson = "{\"status\":\"failed\", \"message\":\"Device registration failed. Check token or server.\"}" ;
        }
      } else {
        responseJson = "{\"status\":\"failed\", \"message\":\"JSON parsing error: " + String(error.c_str()) + "\"}";
      }
    }
    server.send(200, "application/json", responseJson);
  });

  server.begin();
  DEBUG_SERIAL.println("HTTP server started.");
}

// =====================================================
// FUNGSI OTA UPDATE
// =====================================================
void checkOTAUpdate() {
  DEBUG_SERIAL.println("Checking for OTA updates...");
  WiFiClient client;
  t_httpUpdate_return ret = ESPhttpUpdate.update(client, String(API_BASE_URL) + OTA_UPDATE_ENDPOINT);

  switch (ret) {
    case HTTP_UPDATE_FAILED:
      DEBUG_SERIAL.printf("HTTP_UPDATE_FAILED Error (%d): %s\n", ESPhttpUpdate.getLastError(), ESPhttpUpdate.getLastErrorString().c_str());
      break;
    case HTTP_UPDATE_NO_UPDATES:
      DEBUG_SERIAL.println("HTTP_UPDATE_NO_UPDATES");
      break;
    case HTTP_UPDATE_OK:
      DEBUG_SERIAL.println("HTTP_UPDATE_OK"); // Akan restart otomatis
      break;
  }
}

// =====================================================
// SETUP DAN LOOP UTAMA
// =====================================================
void setup() {
  DEBUG_SERIAL.begin(115200); // Kecepatan baud untuk debug
  ARDUINO_SERIAL.begin(9600); // Kecepatan baud untuk komunikasi dengan Arduino
  EEPROM.begin(EEPROM_SIZE); // Inisialisasi EEPROM

  loadCredentials(); // Muat kredensial dari EEPROM

  // Periksa apakah perangkat sudah diprovisioning
  if (idMeter.length() > 0 && deviceJwtToken.length() > 0 && sta_ssid.length() > 0 && sta_password.length() > 0) {
    isDeviceRegistered = true;
    DEBUG_SERIAL.println("Device already provisioned. Connecting to saved WiFi...");
    connectWiFiSTA(); // Langsung coba konek ke Wi-Fi yang tersimpan
  } else {
    DEBUG_SERIAL.println("Device not provisioned. Starting AP mode...");
    setupAPMode(); // Masuk mode AP untuk provisioning
  }
}

void loop() {
  if (WiFi.getMode() == WIFI_AP) {
    server.handleClient(); // Tangani permintaan web di mode AP
    MDNS.update(); // Update mDNS
  } else { // Mode STA (normal operation)
    if (!isWiFiConnected) {
      if (millis() - lastReconnectAttempt > reconnectInterval) {
        lastReconnectAttempt = millis();
        DEBUG_SERIAL.println("WiFi disconnected. Attempting to reconnect...");
        connectWiFiSTA(); // Coba konek ulang
      }
    } else {
      // Logika operasi normal saat terhubung ke Wi-Fi dan terdaftar
      // 1. Poll perintah dari server
      if (millis() - lastCommandPollTime > commandPollInterval) {
        lastCommandPollTime = millis();
        pollForCommands();
      }

      // 2. Baca data dari Arduino dan kirim ke server
      if (ARDUINO_SERIAL.available()) {
        String arduinoData = ARDUINO_SERIAL.readStringUntil('\n');
        arduinoData.trim();
        DEBUG_SERIAL.print("Rx Arduino: "); DEBUG_SERIAL.println(arduinoData);

        DynamicJsonDocument doc(512);
        DeserializationError error = deserializeJson(doc, arduinoData);

        if (!error) {
          String flowRate = doc["flow_rate_lpm"].as<String>();
          String meterReading = doc["meter_reading_m3"].as<String>();
          String voltage = doc["current_voltage"].as<String>();
          int doorStatus = doc["door_status"].as<int>();
          String valveStatus = doc["valve_status"].as<String>(); // Ambil status valve dari Arduino

          sendMeterReading(flowRate, meterReading, voltage, doorStatus, valveStatus);
        } else {
          // Jika ini adalah ACK dari Arduino
          if (arduinoData.indexOf("command_id_ack") != -1) {
            DynamicJsonDocument ackDoc(256);
            DeserializationError ackError = deserializeJson(ackDoc, arduinoData);
            if (!ackError) {
              int commandId = ackDoc["command_id_ack"].as<int>();
              String status = ackDoc["status_ack"].as<String>();
              String notes = ackDoc["notes_ack"].as<String>();
              String reportedValveStatus = ackDoc["valve_status_ack"].as<String>(); // Status valve yang dilaporkan Arduino
              sendCommandAck(commandId, status, notes, reportedValveStatus);
            } else {
              DEBUG_SERIAL.print(F("Deserialisasi JSON ACK Arduino gagal: "));
              DEBUG_SERIAL.println(ackError.c_str());
            }
          } else {
            DEBUG_SERIAL.print(F("Deserialisasi JSON data Arduino gagal: "));
            DEBUG_SERIAL.println(error.c_str());
          }
        }
      }

      // 3. Cek OTA Update
      if (millis() - lastOTACheckTime > otaCheckInterval) {
        lastOTACheckTime = millis();
        checkOTAUpdate();
      }
    }
  }
}
